With special guest, Corbette Jackson!

Kip Moore splashed into the mainstream with the double-Platinum “Somethin’ ‘Bout a Truck” in 2012, then followed up with three more bestselling #1s (“Hey Pretty Girl,” “Beer Money,” and “More Girls Like You”), a trio of ambitious, critically acclaimed albums and two gritty EPs. He tours the world headlining his own shows, earning acclaim, and a fierce following as an all-in performer in each setting. The Georgia native has won 3 American Country Awards, 1 CMT Award, and was the 2014 Country Music Association New Artist of the Year Award winner.

